import React, { Component } from "react";
import cat from '../img/cat.png';
class Footer extends Component {
  render() {
    return (
      <div className="footer">
        <div className="img">
        <div>

        </div>
          <img src={cat} alt="cat"/>
        </div>
        <div  className="coppy">
           <h3>Coppy Right 2019+</h3> 
        </div>
      </div>
    );
  }
}

export default Footer;
